#
# Structure for table "terminal"
#

DROP TABLE IF EXISTS `terminal`;
CREATE TABLE `terminal` (
  `ID` varchar(32) DEFAULT NULL,
  `TERMINAL_ID` varchar(32) NOT NULL DEFAULT '' COMMENT '终端编号',
  `TERMINAL_NAME` varchar(50) NOT NULL DEFAULT '' COMMENT '终端名称',
  `TERMINAL_IP` varchar(25) NOT NULL DEFAULT '' COMMENT '终端IP',
  `TERMINAL_PORT` varchar(10) DEFAULT NULL COMMENT '终端端口',
  `BANK_ID` varchar(32) DEFAULT NULL COMMENT '银行网点',
  `STORAGE_ID` varchar(32) DEFAULT NULL COMMENT '存储设备编号',
  `STATUS` varchar(2) NOT NULL DEFAULT '' COMMENT '是否启用',
  `UPLOAD_TIME` time NOT NULL DEFAULT '00:00:00' COMMENT '上传开始时间',
  `PRE_TIME` int(11) NOT NULL DEFAULT '0' COMMENT '预录像时间',
  `DELAY_TIME` int(11) NOT NULL DEFAULT '0' COMMENT '录像延迟时间',
  `TIME_END` time NOT NULL DEFAULT '00:00:00' COMMENT '上传结束时间',
  `EMP_ID` varchar(32) DEFAULT NULL COMMENT '员工编号',
  `IS_NORMAL` varchar(1) DEFAULT '0' COMMENT '正常工作状态',
  PRIMARY KEY (`TERMINAL_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

